//"SPDX-License-Identifier: UNLICENSED"

pragma solidity 0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

import "./interfaces/ILiquidity.sol";

contract Vitta is ERC20, Ownable, Pausable {

    address private liquidityManager;

    constructor(
        string memory tokenName,
        string memory tokenSymbol,
        uint256 _supply
    ) ERC20(tokenName, tokenSymbol) {
        _mint(msg.sender, _supply);
    }

    function createSupply(uint256 supply) public onlyOwner {
        _mint(msg.sender, supply);
    }

    function setManager(address manager) public onlyOwner {
        liquidityManager = manager;
    }

    function mint(address creditTo, uint256 amount) external {
        require(msg.sender==liquidityManager, "Unauthorized minting");
        _mint(creditTo, amount);
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        require(super.transferFrom(sender, recipient, amount)==true, "Transfer of Vitta tokens failed");
        //if transferor is not the liquidity contract itself, transfer underlying stakes as well
        if(msg.sender!=liquidityManager){
            ILiquidity(liquidityManager).transfer(sender, recipient, amount);
        }
        return true;
    }

    /**
        Pauses this contract
     */
    function pause() public onlyOwner {
        _pause();
    }
    
    /**
        Unpauses this contract
     */
    function unpause() public onlyOwner {
        _unpause();
    }

}
